query.sparql:
SELECT (COUNT(?Reaction) AS ?ReactionCount) WHERE {
  ?Reaction ^okin:hasReaction ?Mechanism .
  ?Mechanism okin:hasProvenance/oprvn:hasDOI "https://doi.org/10.1016/j.combustflame.2007.10.024" .
}

SELECT ?HOMOMinus1Energy ?LevelOfTheoryLabel WHERE {
  ?MolecularComputation occ:hasSpeciesModel/occ:hasSpecies/rdfs:label "CN-" .
  ?MolecularComputation occ:hasMethodology/occ:hasBasisSet/rdfs:label ?BasisSetLabel .
  VALUES ?BasisSetLabel { "cc-pVTZ" "6-311G" }
  ?MolecularComputation occ:hasResult ?HOMOMinus1Energy .
  ?HOMOMinus1Energy a occ:HOMOMinus1Energy .
  ?MolecularComputation occ:hasMethodology/occ:hasLevelOfTheory/rdfs:label ?LevelOfTheoryLabel .
}

