  ?Reaction ocape:hasReactant/skos:altLabel "C11OOH1-OO3-2" .
}

SELECT ?CovalentUnitCount WHERE {
  VALUES ?Species { "C12H6Cl4O2S" }
  ?Species os:hasCovalentUnitCount ?CovalentUnitCount .
}

SELECT ?HydrogenBondDonorCount WHERE {
  ?Species os:hasChemicalClass/rdfs:label "nitrogen molecular entity" .
  ?Species os:hasChemicalClass/rdfs:label "organic molecular entity" .
  ?Species os:hasHydrogenBondDonorCount ?HydrogenBondDonorCount .
}

SELECT ?MonoIsotopicWeight ?UseLabel WHERE {
  VALUES ?Species { "InChI=1S/C17H23N3O/c1-19(2)12-13-20(17-6-4-5-11-18-17)14-15-7-9-16(21-3)10-8-15/h4-11H,12-14H2,1-3H3" }
  ?Species os:hasMonoIsotopicWeight ?MonoIsotopicWeight .
  ?Species os:hasUse/rdfs:label ?UseLabel .
}

SELECT ?Species WHERE {
  ?Species os:hasViscosity/os:value ?ViscosityValue .
  FILTER ( ?ViscosityValue > 0.00132*0.9 && ?ViscosityValue < 0.00132*1.1 )
}

SELECT ?LogP WHERE {
  VALUES ?Species { "C(CCC(=O)O)CCN" "3-(3,4-dichlorophenyl)-1-methoxy-1-methyl-urea" }
  ?Species os:hasLogP ?LogP .
}

SELECT ?OpticalRotation WHERE {
  VALUES ?Species { "C6H14O" }
  ?Species os:hasOpticalRotation ?OpticalRotation .
}

SELECT ?BondChiralCount ?Charge WHERE {
  VALUES ?Species { "tris(fluoranyl)-lambda3-chlorane" }
  ?Species os:hasBondChiralCount ?BondChiralCount .
  ?Species os:hasCharge ?Charge .
}

SELECT ?SCFEnergy ?OptimizedGeometry WHERE {
  ?MolecularComputation occ:hasSpeciesModel/occ:hasSpecies/rdfs:label "Ag" .
  ?MolecularComputation occ:hasMethodology/occ:hasLevelOfTheory/rdfs:label ?LevelOfTheoryLabel .
  VALUES ?LevelOfTheoryLabel { "HF" }
  ?MolecularComputation occ:hasMethodology/occ:hasBasisSet/rdfs:label ?BasisSetLabel .
  VALUES ?BasisSetLabel { "aug-cc-pVDZ" "cc-pVQZ" "STO-5G" }
  ?MolecularComputation occ:hasResult ?SCFEnergy .
  ?SCFEnergy a occ:SCFEnergy .
  ?MolecularComputation occ:hasResult ?OptimizedGeometry .
  ?OptimizedGeometry a occ:OptimizedGeometry .
}

SELECT ?VaporPressure ?FlashPoint ?XLogP3 WHERE {
  VALUES ?Species { "CN(CC(=O)O)C(=N)N" "5-ethyl-5-pentan-2-yl-1,3-diazinane-2,4,6-trione" }
  ?Species os:hasVaporPressure ?VaporPressure .
  ?Species os:hasFlashPoint ?FlashPoint .
  ?Species os:hasXLogP3 ?XLogP3 .
}

SELECT ?PolarSurfaceArea WHERE {
  VALUES ?Species { "C1=CC(=CC=C1C(=O)O)Cl" }
  ?Species os:hasPolarSurfaceArea ?PolarSurfaceArea .
}

SELECT ?PolarSurfaceArea ?ChebiID WHERE {
  VALUES ?Species { "6-amino-5-fluoro-1<I>H</I>-pyrimidin-2-one" }
  ?Species os:hasPolarSurfaceArea ?PolarSurfaceArea .
  ?Species os:hasChebiID ?ChebiID .
}

SELECT ?LUMOEnergy WHERE {
  ?MolecularComputation occ:hasSpeciesModel/occ:hasSpecies/rdfs:label "F2O" .
  ?MolecularComputation occ:hasMethodology/occ:hasLevelOfTheory/rdfs:label ?LevelOfTheoryLabel .
  VALUES ?LevelOfTheoryLabel { "RB3LYP" }
  ?MolecularComputation occ:hasResult ?LUMOEnergy .
  ?LUMOEnergy a occ:LUMOEnergy .
}

SELECT ?HydrogenBondDonorCount WHERE {
  VALUES ?Species { "InChI=1S/C21H21O4P/c1-16-4-10-19(11-5-16)23-26(22,24-20-12-6-17(2)7-13-20)25-21-14-8-18(3)9-15-21/h4-15H,1-3H3" "C8H11N" }
  ?Species os:hasHydrogenBondDonorCount ?HydrogenBondDonorCount .
}

SELECT ?HOMOEnergy ?BasisSetLabel WHERE {
  ?MolecularComputation occ:hasSpeciesModel/occ:hasSpecies/rdfs:label "Cl2" .
  ?MolecularComputation occ:hasResult ?HOMOEnergy .
  ?HOMOEnergy a occ:HOMOEnergy .
  ?MolecularComputation occ:hasMethodology/occ:hasBasisSet/rdfs:label ?BasisSetLabel .
}

SELECT ?ZeroPointEnergy ?RotationalConstants WHERE {
  ?MolecularComputation occ:hasSpeciesModel/occ:hasSpecies/rdfs:label "Ac" .
  ?MolecularComputation occ:hasMethodology/occ:hasLevelOfTheory/rdfs:label ?LevelOfTheoryLabel .
  VALUES ?LevelOfTheoryLabel { "HF" }
  ?MolecularComputation occ:hasMethodology/occ:hasBasisSet/rdfs:label ?BasisSetLabel .
  VALUES ?BasisSetLabel { "CC-pVTZ" "aug-cc-pVQZ" }
  ?MolecularComputation occ:hasResult ?ZeroPointEnergy .
  ?ZeroPointEnergy a occ:ZeroPointEnergy .
  ?MolecularComputation occ:hasResult ?RotationalConstants .
  ?RotationalConstants a occ:RotationalConstants .
}

SELECT (COUNT(?Species) AS ?SpeciesCount) WHERE {
  ?Species okin:belongsToPhase/^okin:hasGasPhase ?Mechanism .
  ?Mechanism okin:hasProvenance/oprvn:hasDOI "https://doi.org/10.1002/kin.20603" .
}
